  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Innoko
  NWR outlines Refuge accomplishments during the 1989 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. The report includes
  a planning section which discusses management planning. Refuge administration is
  outlined; information about personnel, youth programs, volunteer programs, funding,
  safety, and technical assistance is given. Habitat management is also covered; subjects
  include wetlands, fire management, and wilderness areas. The wildlife section of
  the report discusses wildlife diversity, endangered and threatened species, waterfowl,
  shorebirds, raptors, game mammals, marine mammals, and marking and bird banding.
  The public uses of the Refuge described in this report include outdoor classrooms,
  interpretive programs, hunting, fishing, trapping, and law enforcement. The equipment
  and facilities section of the report provides information about major maintenance,
  equipment replacement, communication systems, and computer systems. Cooperative
  programs are provided at the end.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
